import { Col, Row } from "antd";
import { lazy, Suspense  } from "react";
import IntroContent from "../../content/IntroContent.json";
import MiddleBlockContent from "../../content/MiddleBlockContent.json";
import { BackgroundImageContainer } from "../../common/BackgroundImage/styles";
import { Spin } from "antd";

// import AboutContent from "../../content/AboutContent.json";
// import MissionContent from "../../content/MissionContent.json";
// import ProductContent from "../../content/ProductContent.json";
// import ContactContent from "../../content/ContactContent.json";


const Contact = lazy(() => import("../../components/ContactForm"));
const MiddleBlock = lazy(() => import("../../components/ContentBlock/MiddleContentBlock"));
const Container = lazy(() => import("../../common/Container"));
const ScrollToTop = lazy(() => import("../../common/ScrollToTop"));
const ContentBlock = lazy(() => import("../../components/ContentBlock"));
// const Slider = lazy(() => import("../../components/Slider"));


const images = [
  { src: 'food-intro-image2.jpg', alt: 'Image 1', title: 'Item No. 1' },
  { src: 'food-intro-image2.jpg', alt: 'Image 2', title: 'Item No. 2' },
  { src: 'food-intro-image2.jpg', alt: 'Image 3', title: 'Item No. 3' },
  { src: 'food-intro-image2.jpg', alt: 'Image 4', title: 'Item No. 4' },
  { src: 'food-intro-image2.jpg', alt: 'Image 5', title: 'Item No. 5' },
];
const Home = () => {
  return (
    <>
      <ScrollToTop />
        <BackgroundImageContainer>
          <Row justify="center" align="middle">
            <Col xs={24} sm={20} md={16} lg={12}>
              <Suspense fallback={<Spin />}>
                <ContentBlock
                  id="intro"
                  type="right"
                  title={IntroContent.title}
                  image={IntroContent.image}
                  button={IntroContent.button}
                />
              </Suspense>
            </Col>
          </Row>
        </BackgroundImageContainer>
      <Container padding="1% 0" maxWidth="1700px">
        <BackgroundImageContainer 
          height="100%"
          fixed={false}
          backgroundImage="/images/couch-area.jpg" >
        <MiddleBlock
          title={MiddleBlockContent.title}
          content={MiddleBlockContent.text}
          button={MiddleBlockContent.button}
        />
        </BackgroundImageContainer>
      </Container>

      <BackgroundImageContainer backgroundImage="/images/background.jpg" fixed={true}></BackgroundImageContainer>
      
      <Container padding="10% 0" maxWidth="2000px">
      </Container>
    </>
  );
};

export default Home;
